import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title navbar__item" }, "Cutco"),
    React.createElement("div", { className: "navbar__item" }, "About Us"), 
    React.createElement("div", { className: "navbar__item" }, "Contact"), 
React.createElement("div", { className: "navbar__item" }, "Help")
  ))
}


export default Navbar
